import React, { FC } from 'react';

interface InviteMembersModalProps {
  isOpen?: boolean;
  onClose?: () => void;
  onMemberAdded?: () => void;
  projectId?: string;
}

const InviteMembersModal: FC<InviteMembersModalProps> = ({ isOpen, onClose, onMemberAdded, projectId }) => {
  return <div className="p-4">Invite members modal coming soon</div>;
};

export default InviteMembersModal;
